INSERT INTO `customer_entity_text` VALUES (1,177,5,'Sample Customer from 3dcart'),(2,177,14,'Braiding Specialist'),(3,177,15,'LOVE YOUR HAIR COLOR!!'),(4,177,17,'I\'m a licensed Hairdresser/Stylist and I love your products. I\'m so excited to find out about your hair color and make up  line'),(5,177,18,'SO glad that your site is finally up and running!!!'),(6,177,39,'Black soap for Kelsey '),(7,177,48,'Good solid product'),(8,177,67,'I love your Men\'s Products'),(9,177,85,'Good morning, I live in french west indies(martinique) and I would like to become a shea moisture product retailer. How do I do? kind regards Jenna'),(10,177,88,'Dear Sheamoisture, I am the owner of Hair by ergatta salon and would like to purchase some of your sheamoisture products. Can you please provide your wholesale pricing? Thank you and look forward to your reply.'),(11,177,102,'My local target used to carry your hair color line. I can\'t find it anywhere now. Will Shea Moisture hair color come back to stores? '),(12,177,126,'When will you have an online store?? Most of the products I cannot find the stores.'),(13,177,161,'love sheamoisture. the best ever. BUT:] MEED TO BUY SUM COLOR PLSS..'),(14,177,165,'Please send samples of the JBCO line ... i cannot find it in our stores! & coupon Thank you.'),(15,177,179,'I am now a fan of your products'),(16,177,180,'I love the Shea moisture products'),(17,177,182,'i cannot find your products anymore'),(18,177,183,'I would like samples of the products....'),(19,177,210,'I would like to buy your wet/dry powder and other cosmetics, but i need to know where in and around my area your cosmetic is sold?  Thank you'),(20,177,215,'I think I single handed started the whole Shea Moisture phenomenon, lol!  Sooo many folks would ask me what I use on my curly hair.  I\'d say Shea Moisture curl enhancing smoothie and next thing I know, I can\'t find it on the shelf anymore!'),(21,177,221,'Can\'t wait to get shea moisture cosmetics sold in Target in Oklahoma City. '),(22,177,240,'I have been looking for a product that last in my daughter\'s hair and I absolutely love it. I am such a advocate for this product and referred so many people.  '),(23,177,270,'I would like to purchase a case of Shea Moisture Curl Enhancing smoothie'),(24,177,276,'Great products'),(25,177,298,'I LOVE Shea Moisture and am sooooo elated that the site is finally up and running! I just need these stores to carry your full line!');
/*!40000 ALTER TABLE `customer_entity_text` ENABLE KEYS */;
UNLOCK TABLES;

